import PictureButton from './../../components/PictureButton.js'

import './Landing.css';
import design from './../../assets/design.jpeg';
import software from './../../assets/software.png';

function Landing() {
  return (
      <div class="landing">
            <div class="text-container">
                <p class="big-text"> Izzie Lau </p>
                <p class="text"> üìç <b>Sunnyvale, California</b>‚Ä®</p>
                <p class="text"></p>
                <p class="text">Software Engineer @ <b>Microsoft</b></p>
                <p class="text">CS + Cognitive Science @ <b>UC Berkeley</b></p>
                <p class="text"></p>
                <p class="text-italic">work in progress!! </p>
                <p class="text-italic">check back in a few weeks! </p>
            </div>
            <div class="button-container">
                <PictureButton image=<img class="image" src={software}/> subtitle="software ‚Üí" />
                <PictureButton image=<img class="image" src={design}/> subtitle="design ‚Üí" />
            </div>
      </div>
  );
}

export default Landing;
